import './App.css';
import Avatar from './components/Avatar';
import Myfullname from './components/Myfullname';
import Description from './components/Description';

function App() {
	return (
		<div className="App">
			<div className='container container_two'>
				<div className='my_information'>
					<Myfullname firstName='Pavel' lastName='Liashkevich' />
					<Description description={info} />	
				</div>	
				<div className='image image2'>
					<Avatar src='Image/image_front_end.png'/>
				</div>
			</div>
		</div>
	);
}

const info = `I am learning on courses on frontend development. my skills are HTML, CSS, Figma, JavaScript, Git, I am currently studying React.in the future I plan to get a job as a Front-end developer. I am easy and fast learner, work well in a team and am not afraid of difficulties  `;

export default App;
